from typing import List
from functools import lru_cache


class Solution:
    def minSideJumps(self, obstacles: List[int]) -> int:
        dp = {}
        n = len(obstacles) - 1
        sys.setrecursion()

        def solve(index, lane):
            if index == n:
                return 0

            if (lane, index) in dp:
                return dp[(lane, index)]


            if (obstacles[index + 1] - 1) != lane:
                return solve(index + 1, lane)

            mn = float("inf")
            for i in range(3):
                if i != lane and (obstacles[index] - 1) != i:
                    mn = min(mn, 1 + solve(index, i))

            dp[(lane, index)] = mn
            return mn

        return solve(0, 1)


